import './component styles/Organizers.css';
import { Grid } from '@mui/material';
import azim from '../assets/images/AKRAMUL_AZIM.jpg'

function Organizers(){
    return(
        <div className="tutorialformat">
            <Parallax pages={2.7} style={{backgroundColor: colorCodes.white}}>

                <ParallaxLayer 
                    speed={1}
                >

                    <Grid direction="row">

                        <Grid direction="column">
                            <img src={azim} width={75} height={100}/>
                        </Grid>

                        <Grid direction="column">

                        </Grid>

                    </Grid>   

                </ParallaxLayer>

            </Parallax>
        </div>
    );
}

export default Organizers;
